import React from "react";
import ReactDOM from "react-dom";

class Services extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="mt-5 mb-5">
        <div className="container">
          <div className="row">
            <h2> Services</h2>
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
